import './App.css';
import Post from './Post.js';
import { posts } from './data.js'
import { useEffect, useState } from 'react';
import Axios from 'axios'


function App() {
  return (
    <div className="App">
      <ShowFetch/>
     <Feed/>
    </div>
  );
}

function Feed() {
  return (
  <Post post={posts[0]}/>
  )
}

function ShowFetch() {
  const [ posts, setPosts ] = useState([null])

  useEffect(() => {
    getPosts();
  }, [])

  const getPosts = () => {
  Axios.get('http://localhost:3001/api').then((response) => {
      setPosts(response.data)
    })}

  // console.log((posts[0]))

  if (posts.length > 0) {
  return (
    <div>
      {posts.map((post, i) => {
        <li key={i}>
          {console.log(i)}
          <h1>{i}</h1>
        </li>
      })}
    </div> 
  )}
}




export default App;
